import React, { Component } from "react";

class TotalTimer extends Component {
  render() {
    return <div />;
  }
}

stopwatch = () => {
  <div>
    <p>0ms</p>
    <button>Start</button>
    <button>Reset</button>
  </div>;
};

export default TotalTimer;
